/*Table structure for table `co_contract_product` */

DROP TABLE IF EXISTS `co_contract_product`;

CREATE TABLE `co_contract_product` (
  `id` varchar(40) NOT NULL,
  `contract_id` varchar(40) DEFAULT NULL,
  `factory_id` varchar(40) DEFAULT NULL,
  `factory_name` varchar(200) DEFAULT NULL COMMENT '冗余',
  `product_no` varchar(50) DEFAULT NULL,
  `product_image` varchar(200) DEFAULT NULL,
  `product_desc` varchar(255) DEFAULT NULL,
  `loading_rate` varchar(80) DEFAULT NULL COMMENT '报运：x/y',
  `box_num` double(11,0) DEFAULT NULL COMMENT '报运',
  `packing_unit` varchar(10) DEFAULT NULL COMMENT 'PCS/SETS',
  `cnumber` decimal(11,0) DEFAULT NULL,
  `out_number` decimal(11,0) DEFAULT NULL COMMENT '报运',
  `finished` double(11,0) DEFAULT NULL COMMENT '报运',
  `product_request` varchar(255) DEFAULT NULL,
  `price` double(10,2) DEFAULT NULL,
  `amount` double(10,2) DEFAULT NULL COMMENT '自动计算: 数量x单价',
  `order_no` double(11,0) DEFAULT NULL,
  `company_id` varchar(40) DEFAULT NULL,
  `company_name` varchar(40) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `FK_Reference_14` (`contract_id`),
  KEY `FK_Reference_8` (`factory_id`),
  CONSTRAINT `FK_Reference_14` FOREIGN KEY (`contract_id`) REFERENCES `co_contract` (`id`),
  CONSTRAINT `FK_Reference_8` FOREIGN KEY (`factory_id`) REFERENCES `co_factory` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

