/*Table structure for table `co_ext_eproduct` */

DROP TABLE IF EXISTS `co_ext_eproduct`;

CREATE TABLE `co_ext_eproduct` (
  `id` varchar(40) NOT NULL,
  `export_product_id` varchar(40) DEFAULT NULL,
  `export_id` varchar(40) DEFAULT NULL COMMENT '所属报运单id',
  `factory_id` varchar(40) DEFAULT NULL,
  `product_no` varchar(50) DEFAULT NULL,
  `product_image` varchar(200) DEFAULT NULL,
  `product_desc` varchar(255) DEFAULT NULL,
  `cnumber` decimal(11,0) DEFAULT NULL,
  `packing_unit` varchar(10) DEFAULT NULL COMMENT 'PCS/SETS',
  `price` decimal(10,2) DEFAULT NULL,
  `amount` decimal(10,2) DEFAULT NULL COMMENT '自动计算: 数量x单价',
  `product_request` text,
  `order_no` decimal(11,0) DEFAULT NULL,
  `company_id` varchar(40) DEFAULT NULL,
  `company_name` varchar(40) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `FK_Reference_11` (`factory_id`),
  KEY `FK_Reference_13` (`export_product_id`),
  CONSTRAINT `FK_Reference_11` FOREIGN KEY (`factory_id`) REFERENCES `co_factory` (`id`),
  CONSTRAINT `FK_Reference_13` FOREIGN KEY (`export_product_id`) REFERENCES `co_export_product` (`id`)
