/*Table structure for table `co_finance` */

DROP TABLE IF EXISTS `co_finance`;

CREATE TABLE `co_finance` (
  `FINANCE_ID` varchar(40) NOT NULL,
  `INPUT_DATE` datetime DEFAULT NULL,
  `INPUT_BY` varchar(30) DEFAULT NULL,
  `STATE` int(11) DEFAULT NULL COMMENT '0草稿 1已上报',
  `CREATE_BY` varchar(40) DEFAULT NULL,
  `CREATE_DEPT` varchar(40) DEFAULT NULL,
  `CREATE_TIME` datetime DEFAULT NULL,
  PRIMARY KEY (`FINANCE_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='和装箱单一对一';

/*Data for the table `co_finance` */

/*Table structure for table `co_invoice` */

DROP TABLE IF EXISTS `co_invoice`;

CREATE TABLE `co_invoice` (
  `INVOICE_ID` varchar(40) NOT NULL COMMENT 'PACKING_LIST_ID值',
  `SC_NO` varchar(100) DEFAULT NULL COMMENT 'packing.getExportNos S/C就是报运的合同号',
  `BL_NO` varchar(100) DEFAULT NULL,
  `TRADE_TERMS` varchar(100) DEFAULT NULL,
  `STATE` int(11) DEFAULT NULL COMMENT '0草稿 1已上报',
  `CREATE_BY` varchar(40) DEFAULT NULL,
  `CREATE_DEPT` varchar(40) DEFAULT NULL,
  `CREATE_TIME` datetime DEFAULT NULL,
  PRIMARY KEY (`INVOICE_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='和装箱单一对一';

/*Data for the table `co_invoice` */

/*Table structure for table `co_packing_list` */

DROP TABLE IF EXISTS `co_packing_list`;

CREATE TABLE `co_packing_list` (
  `packing_list_id` varchar(40) NOT NULL,
  `seller` varchar(200) DEFAULT NULL,
  `buyer` varchar(200) DEFAULT NULL,
  `invoice_no` varchar(30) DEFAULT NULL COMMENT '选择',
  `invoice_date` datetime DEFAULT NULL,
  `marks` varchar(200) DEFAULT NULL,
  `descriptions` varchar(200) DEFAULT NULL,
