  `USER_TEMP_ID` varchar(40) NOT NULL,
  `KEY_CLASS` varchar(30) DEFAULT NULL,
  `KEY_NAME` varchar(30) DEFAULT NULL,
  `KEY_CONTENT` varchar(3000) DEFAULT NULL,
  `STATE` int(11) DEFAULT '1' COMMENT '0停用1启用\n            ',
