  `CNOTE` varchar(50) DEFAULT NULL,
  `UPDATE_BY` varchar(40) DEFAULT NULL,
  `UPDATE_TIME` datetime DEFAULT NULL,
  PRIMARY KEY (`USER_TEMP_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

